import React from "react";
import Link from "next/link";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container } from "react-bootstrap";

const Layout: React.FC = ({ children }) => {
  return (
    <Container>
      <h1>Hello</h1>
      {children}
    </Container>
  );
};

export default Layout;
